import React from "react";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import Dropdown from "react-dropdown";
import "react-dropdown/style.css";
import "./App.css";

const occupations = [
  { value: "student", label: "Student" },
  { value: "employed", label: "Employed" },
  { value: "other", label: "Other" }
];

export default function SignUpPart2() {
  return (
    <div class="login-header">
      <h2>Complete Profile Info</h2>
      <form method="post">
        <label for="full_name">Full Name:</label>
        <input
          id="login-box"
          type="name"
          name="full_name"
          placeholder="ex. John Doe"
          required
        ></input>
        <br />
        <label for="occupation">Occupation:</label>
        <Dropdown
          options={occupations}
          value="<select from below>"
          placeholder="Select an occupation."
        />
        <label for="comp/school">Company/School:</label>
        <input id="login-box" type="text" name="occupation"></input>
        <br />
        <label for="email">Email:</label>
        <input
          id="login-box"
          type="email"
          name="email"
          placeholder="ex. john.doe@email.com"
          required
        ></input>
        <br />
        <label for="phone_cell">Cell Phone:</label>
        <input
          id="login-box"
          type="tel"
          name="phone"
          pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}"
          placeholder="ex. XXX-XXX-XXXX"
          required
        ></input>
        <br />
        <button type="submit">Finish Sign Up</button>
      </form>
    </div>
  );
}
